// SPDX-License-Identifier: MIT OR Apache-2.0
pragma solidity ^0.8.3;

struct MarketItem {
    address nftContract;
    uint256 tokenId;
    address payable owner;
    address payable creator;
    uint256 price;
    bool isListed;
    uint256 royalty;
    uint256 eventCount;
    uint256 offerCount;
    string name;
    string collectionName;
}

contract NFTMarketItems {

    mapping(uint256 => MarketItem) public idToMarketItem;

    function _getMarketItem(uint256 tokenId) external view returns (MarketItem memory) {
        return idToMarketItem[tokenId];
    }

    function _getItemEventCount(uint256 tokenId) external view returns (uint256) {
        return idToMarketItem[tokenId].eventCount;
    }

    function _getItemIsListed(uint256 tokenId) external view returns (bool) {
        return idToMarketItem[tokenId].isListed;
    }

    function _getItemPrice(uint256 tokenId) external view returns (uint256) {
        return idToMarketItem[tokenId].price;
    }

    function _getItemRoyalty(uint256 tokenId) external view returns (uint256) {
        return idToMarketItem[tokenId].royalty;
    }

    function _getItemOwner(uint256 tokenId) external view returns (address payable) {
        return idToMarketItem[tokenId].owner;
    }

    function _getItemCreator(uint256 tokenId) external view returns (address payable) {
        return idToMarketItem[tokenId].creator;
    }

    function _getItemCollectionName(uint256 tokenId) external view returns (string memory) {
        return idToMarketItem[tokenId].collectionName;
    }

    function _getItemOfferCount(uint256 tokenId) external view returns (uint256) {
        return idToMarketItem[tokenId].offerCount;
    }

    function _getItemContract(uint256 tokenId) external view returns (address) {
        return idToMarketItem[tokenId].nftContract;
    }

    function _addMarketItem(address nftContract, uint256 tokenId, address payable owner, address payable creator, uint256 price, bool isListed, uint256 royalty, uint256 eventCount, string memory name, string memory collectionName) external {
        idToMarketItem[tokenId] = MarketItem(nftContract, tokenId, owner, creator, price, isListed, royalty, eventCount, 0, name, collectionName);
    }

    function _setItemIsListed(uint256 tokenId, bool status) external {
        idToMarketItem[tokenId].isListed = status;
    }

    function _incrementEventCount(uint256 tokenId) external {
        idToMarketItem[tokenId].eventCount += 1;
    }

    function _setItemPrice(uint256 tokenId, uint256 price) external {
        idToMarketItem[tokenId].price = price;
    }

    function _setItemOwner(uint256 tokenId, address payable owner) external {
        idToMarketItem[tokenId].owner = owner;
    }

    function _setItemOfferCount(uint256 tokenId, uint256 offerCount) external {
        idToMarketItem[tokenId].offerCount = offerCount;
    }

    function _incrementOfferCount(uint256 tokenId) external {
        idToMarketItem[tokenId].offerCount += 1;
    }
}
